'''Baba Yaga''' is a member of the [[Moon Clan]] on [[Lunar Isle]] who lives in a house named [[Berty]]. She is admittedly insane and runs [[Baba Yaga's Magic Shop]], which sells [[runes]], [[battlestaves]], and [[Moonclan manual]]s.

In order to talk to her and most other NPCs in the city, the [[seal of passage]] obtained during [[Lunar Diplomacy]] is required to be held. If spoken to without a seal of passage, the player will be teleported away to [[Rellekka]] even if they have completed Lunar Diplomacy.

Players who have completed Lunar Diplomacy and have level 71 [[Magic]] can talk to Baba Yaga on Lunar Isle to unlock the [[Ourania teleport]] spell. The [[Lunar spellbook]] '''must''' be equipped before you speak to her in order to unlock the teleport.

The price runes are sold at increases with reduced stock significantly faster than most other magic shops.

